@borg.on(admin_cmd(pattern=r"lul$"))
async def _(event):
	if event.fwd_from:
		return
	deq = deque(list("ЁЯШВЁЯдгЁЯШВЁЯдгЁЯШВЁЯдг"))
	for _ in range(20):
		await asyncio.sleep(0.6)
		await event.edit("".join(deq))
		deq.rotate(1)

    
