@borg.on(admin_cmd(pattern="wtf$"))
async def _(event):
    if event.fwd_from:
        return
    animation_interval = 0.5
    animation_ttl = range(0, 5)
    await event.edit("wtf")
    animation_chars = [
            "What",
            "What The",
            "What The F",
            "What The F Brah"
            
        ]
    for i in animation_ttl:
        	
            await asyncio.sleep(animation_interval)
            await event.edit(animation_chars[i % 5 ])   

        
